import React, { useState } from 'react';
import TrackingStatus from '../components/homePage/trackingStatus';
import { Link } from 'react-router-dom';
import { Button, Box, Typography } from '@mui/material';
import Register from '../components/auth/Register';
import Login from '../components/auth/Login';

const HomePage = () => {
  const [showRegister, setShowRegister] = useState(false);
  const [showLogin, setShowLogin] = useState(false);
  const [userId, setUserId] = useState(null);

  const handleShowRegister = () => {
    setShowRegister(true);
    setShowLogin(false);
  };

  const handleShowLogin = () => {
    setShowRegister(false);
    setShowLogin(true);
  };

  const handleRegisterSuccess = (id) => {
    setUserId(id);
    setShowRegister(false);
    setShowLogin(true);
    //console.log('Registered user ID:', id); // Выводим ID пользователя в консоль
  };

  return (
    <div>
      <Box display="flex" alignItems="center" mb={2}>
        <Typography variant="h4" component="h1" mr={2}>
          Заказы
        </Typography>
        <Button variant="contained" color="primary" component={Link} to="/expenses">
          Затраты
        </Button>
        <Button variant="contained" color="secondary" component={Link} to="/metrics">
          Показатели
        </Button>
        <Button variant="contained" onClick={handleShowRegister}>
          Регистрация
        </Button>
        <Button variant="contained" onClick={handleShowLogin}>
          Вход
        </Button>
      </Box>
      {showRegister && <Register onRegisterSuccess={handleRegisterSuccess} />}
      {showLogin && <Login />}
      <TrackingStatus />
    </div>
  );
};

export default HomePage;
